import styled from "styled-components";
import { TiThMenu } from "react-icons/ti";;


export const HeaderStyled = styled.header`
  display: flex;
  justify-content: space-between;
  align-items: center;
`;

export const MenuIcon = styled(HiMenu)`
fill: #333D4B;
width: 16px;
height: 15px;
`
